) איך זה בדיוק רכיב? לא ברור לי מה כולל רכיב של מניעת ניצול כוח מונופוליסטי
2) גם ככה אנשים יודעים מה המחירים ברשתות מזון הקרובות לבתיהם - יש פה מישהו שלא מודע לזה? ואם לא, איפה האחריות האישית לבדוק? לא באמת כזאת בעיה שדורשת הקמת מנגנון מבואס של פקחים (כי צריך לאמת שהטייקונים הרעים לא משקרים בנתונים שלהם נכון?)
3) כיצד מניעת פתיחת הרבה סניפים בשטח קטן תמנע יצירת מונופולים
